import { Box, Button, Header, Icon, Page, Spinner, useNavigate, useSnackbar } from "zmp-ui";
import React, {
  LegacyRef,
  useEffect,
  useLayoutEffect,
  useMemo,
  useRef,
  useState,
} from "react";
import { useAppDispatch, useAppSelector } from "../redux/common/hooks";
import ListCategoriesResult from "../components/templates/listCategoriesResult";
import {
  getResultDetailChild,
  getResultDetailParent,
  getVitalsignsCustomer,
  setImagePreview,
  setMasterIdExam,
} from "../redux/detailExam";
import PreviewImages from "../components/molecules/imagePreview";
import { ImagePreviewItem } from "../redux/detailExam/types";
import InfoCustomer from "../components/molecules/infoCustomer";
import { useSearchParams } from "react-router-dom";
import { useMutation } from "react-query";
import {
  fetchMasterByMasterId,
  fetchProfileByPhone,
  getAccountByMiniApp,
  getListProfile,
} from "../services/apis/dashboard";
import { getStorage, openShareSheet, setStorage } from "zmp-sdk/apis";
import { useAuthentication } from "../components/custom/authen-provider";
import Loading from "../components/atoms/Loading";
import { Profile } from "../redux/booking/types";
import { useLocation } from 'react-router-dom';
const dataExample = {
  data: "",
  message: "Xuất file báo giá dạng pdf!",
  status: true,
  client_ip: "192.168.15.159"
}
// Khai báo kiểu dữ liệu cho zalolib
interface ZaloLib {
  shareFile?: (options: {
    files: string[];
    success?: () => void;
    fail?: (error: any) => void;
  }) => void;
}

// Mở rộng `window` để thêm zalolib
declare global {
  interface Window {
    zalolib?: ZaloLib;
  }
}

function MedicalExamPageZNS() {
  const dispatch = useAppDispatch();
  const navigate = useNavigate();
  const { openSnackbar } = useSnackbar();
  const { havePhone, phone, fetchData, uuid, isCancel, scope, version, platform, deviceId } =
    useAuthentication();
  const wrapperRef = useRef();

  /* 
    define params:
    variant = default | notification;
    type = PCD | XN | XQ | DT | NS | TDV | EMR | SA | GPB | XNHT | XNSHPT;
  */
  let [searchParams, setSearchParams] = useSearchParams();
  const profileId = searchParams.get("profileId");
  const masterId = searchParams.get("masterId");
  const type = searchParams.get("type");
  const serviceId = searchParams.get("serviceId");
  const variant = searchParams.get("variant");

  const [savedUrl, setSavedUrl] = useState<string>('');
  const location = useLocation();

  const dataImagePreview = useAppSelector(
    (state) => state.detail.dataImagePreview
  );
  const listCategories = useAppSelector((state) => state.detail.listService);
  const masterIdStore = useAppSelector((state) => state.detail.masterIdExam);
  const [stateImagePreview, setStateImagePreview] = useState<ImagePreviewItem>({
    ...dataImagePreview,
  });

  const [collapseActive, setCollapseActive] = useState({
    parent: "",
    children: "",
  });

  const [state, setState] = useState({
    listCategory: listCategories,
    masterId: masterIdStore,
    customerCode: ''
  });

  const [isFirstAccess, setIsFirstAccess] = useState(true);

  const [dataProfile, setDataProfile] = useState<any>();

  useEffect(() => {
    if (variant === "notification") {
      setSavedUrl(location.pathname + location.search);
    }
  }, [location]);

  const getData = async () => {
    try {
      const { profileActive, isLogin } = await getStorage({
        keys: ["profileActive", "isLogin"],
      });
      if (!profileActive?.customer_id || !isLogin) {
        fetchData();
      } else {
        setDataProfile(profileActive);
      }
    } catch (error) {
      console.log(error);
    }
  };

  const { mutate: getProfilesByUsername } = useMutation(
    "post-footer-form",
    (data: any) => getListProfile(data),
    {
      onSuccess: (data) => {
        if (data?.status) {
          const profileRequired = data?.data?.find((item: Profile) => item.customer_id === profileId);
          setDataProfile(profileRequired);
          return setStorage({
            data: {
              profileActive: profileRequired,
              profileIdActive: profileRequired.customer_id,
            },
          })
        }
      },
      onError: (error) => {
        console.log(
          `🚀: error --> getPermission -> getCustomerByCustomerId: ${error}`
        );
      },
    }
  );

  const { mutate: getAccountByPhone } = useMutation(
    "post-footer-form",
    (data: any) => getAccountByMiniApp(data),
    {
      onSuccess: (data) => {
        if (data.status) {
          if (data?.data?.my_profile?.customer_id === profileId) {
            getProfilesByUsername(data?.data?.account?.data?.username)
            return setStorage({
              data: {
                customerId: data?.data?.my_profile?.customer_id,
                isLogin: true,
                account: data?.data,
                accountUserName: data?.data?.account?.data?.username,
              },
            }).then(() => {
              navigate(savedUrl, {
                replace: false,
                animate: true,
              });
            });
          } else {
            return navigate('/switch-profile', {
              replace: false,
              animate: true,
            });
          }
        } else {
          if ([2, 3].includes(data?.data)) {
            return navigate('/create-account', {
              replace: false,
              animate: true,
            });
          } else if ([4].includes(data?.data)) {
            return navigate('/it-support', {
              replace: false,
              animate: true,
            });
          }
        }
      },
      onError: (error) => {
        console.log("🚀: error -->authen getCustomerByCustomerId:", error);
      },
    }
  );

  useEffect(() => {
    if (havePhone && variant === "notification") {
      const body = {
        phone_number: phone,
        uid_zalo: uuid,
        device_id: deviceId,
        device_flatform: platform,
        device_flatform_version: version
      };
      getAccountByPhone(body);
    }
  }, [havePhone, fetchData]);

  useEffect(() => {
    if (isCancel && variant === "notification") {
      openSnackbar({
        position: "top",
        duration: 3000,
        icon: true,
        text: `Không tìm thấy thông tin khách hàng`,
        type: "success",
      });
      return navigate("/dashboard", {
        replace: false,
        animate: true,
      });
    }
  }, [isCancel]);

  useEffect(() => {
    setStateImagePreview({
      ...dataImagePreview,
    });
  }, [dataImagePreview]);

  useEffect(() => {
    if (state.listCategory.length > 0) return;
    setState({
      ...state,
      listCategory: listCategories,
      masterId: masterIdStore,
    });
  }, [listCategories, masterIdStore, window.location]);

  const { mutate: getHistoriesByCustomer } = useMutation(
    "post-footer-form",
    (id: string) => fetchMasterByMasterId(id),
    {
      onSuccess: (data) => {
        if (data.status) {
          setState({
            ...state,
            listCategory: data?.data,
            masterId: masterId as string,
            customerCode: data.data?.master?.customer_id
          });
          (data?.data || [])?.map((item) => {
            if (item?.service_group_type === type) {
              setCollapseActive({
                parent: type as string,
                children:
                  item?.items?.length > 1
                    ? item?.items?.find((y) => y?.id === serviceId)?.id
                    : "",
              });
            }
          });
        }
      },
      onError: (error) => {
        console.log("🚀: error --> booking -> getCustomerByCustomerId:", error);
      },
    }
  );

  useLayoutEffect(() => {
    if (variant === "notification" && !!scope.userInfo && !!scope.userPhoneNumber) {
      getData();
    }
  }, []);

  useLayoutEffect(() => {
    if (variant === "notification" && !scope.userInfo && !scope.userPhoneNumber) {
      fetchData();
    }
  }, []);

  useLayoutEffect(() => {
    if (
      state.listCategory.length === 0 &&
      isFirstAccess &&
      variant === "notification"
    ) {
      dispatch(setMasterIdExam(masterId as string));
      getHistoriesByCustomer(masterId as string);
    }
  }, [dataProfile, masterId, collapseActive, havePhone]);

  useEffect(() => {
    if (dataProfile?.customer_id && variant === "notification") {
      dispatch(
        getVitalsignsCustomer(
          dataProfile?.customer_id
        )
      );
    }
  }, [dataProfile, havePhone]);

  useEffect(() => {
    const body = {
      master_id: masterId,
      service_group_type: type,
      id: serviceId,
    };

    if (
      state.listCategory.length &&
      collapseActive.children.trim() &&
      isFirstAccess &&
      variant === "notification"
    ) {
      dispatch(getResultDetailChild(body));
      setIsFirstAccess(false);
      return;
    }
    if (
      state.listCategory.length &&
      collapseActive.parent.trim() &&
      isFirstAccess &&
      variant === "notification"
    ) {
      dispatch(getResultDetailParent(body));
      setIsFirstAccess(false);
    }
  }, [collapseActive]);

  useLayoutEffect(() => {
    const element = document.getElementById("record-actives");
    const boxChat = wrapperRef.current as any;
    if (
      element &&
      (collapseActive.children.trim() || collapseActive.parent.trim())
    ) {
      boxChat.scrollTo({
        top: Number(element.offsetTop - 60),
        behavior: "smooth",
      });
    }
  }, [collapseActive.children, collapseActive.parent, scope]);

  const memoryInfo = useMemo(
    () => (
      <Box className="">
        <InfoCustomer isChangeInfo={!!dataProfile} />
      </Box>
    ),
    [dataProfile, havePhone]
  );
  const [progress, setProgress] = useState(0);
  const [downloading, setDownloading] = useState(false);

  const startDownload = async () => {
    try {
      setDownloading(true);
      setProgress(0);
  
      // URL API tải file PDF (thay thế bằng API thực tế của bạn)
      console.log(1)
      console.log(dataExample)
      const byteCharacters = atob(dataExample.data);
      const byteNumbers = new Array(byteCharacters.length);
      for (let i = 0; i < byteCharacters.length; i++) {
        byteNumbers[i] = byteCharacters.charCodeAt(i);
      }
      console.log(2)
      const byteArray = new Uint8Array(byteNumbers);
      const blob = new Blob([byteArray], { type: "application/pdf" });
      const file = new File([blob], "result.pdf", { type: "application/pdf" });
      console.log(3)
      // Tạo URL tạm thời cho file
      const fileURL = URL.createObjectURL(file);
      console.log(fileURL)
      // Kiểm tra `zalolib` và gọi API chia sẻ file (Dùng Optional Chaining)
      window.zalolib?.shareFile?.({
        files: [fileURL], // Truyền file vào danh sách chia sẻ
        success: () => console.log("Chia sẻ thành công"),
        fail: (error) => console.error("Lỗi khi chia sẻ:", error),
      });
      console.log(5)
      setDownloading(false);
    } catch (error) {
      console.error("Lỗi tải file:", error);
      setDownloading(false);
    }
  };
  const handleShare = () => {
    const base64PDF = dataExample.data; // Đây là chuỗi Base64 của file PDF

    // Chuyển đổi Base64 thành Blob
    const byteCharacters = atob(base64PDF);
    const byteNumbers = new Array(byteCharacters.length);

    for (let i = 0; i < byteCharacters.length; i++) {
      byteNumbers[i] = byteCharacters.charCodeAt(i);
    }

    const byteArray = new Uint8Array(byteNumbers);
    const blob = new Blob([byteArray], { type: "application/pdf" });

    // Tạo URL tạm thời cho file PDF
    const fileURL = URL.createObjectURL(blob);
    console.log("File URL:", fileURL); // Debug URL để kiểm tra
    openShareSheet({
      type: "link",
        data: {
          link: fileURL, // Sử dụng thuộc tính "link"
          chatOnly: false,
        },
        success: (res) => {
            console.log(res);
        },
        fail: (err) => {
            console.log(err);
        }
    });
};

  const getButtonColor = () => {
    if (progress < 30 && progress > 1) return "bg-[#04566e] text-white";
    if (progress < 70&& progress > 30) return "bg-[#04566e] text-white";
    return "bg-[#04566e] text-white";
  };

  return (
    <Page
      className={"pb-16 px-1 overflow-scroll h-screen bg-[white] relative"}
      ref={wrapperRef as any}
    >
      {variant === "notification" ? (
        dataProfile?.customer_id ? (
          <>
            <Header
              title="Chi tiết lượt khám"
              className="p-booking_headers"
              showBackIcon
              backgroundColor="#fff"
              onBackClick={() => navigate("/dashboard", { replace: false, animate: true, })}
            />
            <Box height={60} />
            {memoryInfo}
            <div className="mt-2 overflow-scroll detail-exam-wrapper">
              {state.listCategory
                ?.filter((fill) => fill.service_group_type !== "EMR")
                ?.map((item, index) => (
                  <div
                    key={index}
                    id={
                      collapseActive.parent === item.service_group_type
                        ? "record-actives"
                        : ""
                    }
                  >
                    <ListCategoriesResult
                      data={item}
                      pageActive={
                        collapseActive.parent === item.service_group_type
                      }
                      onClickCollapse={(data: any) => {
                        const body = {
                          master_id: state.masterId,
                          service_group_type: data,
                          id: !!item.items?.length ? item.items[0].id : "",
                        };
                        if (collapseActive.parent === data) {
                          setCollapseActive({ ...collapseActive, parent: "" });
                        } else {
                          dispatch(getResultDetailParent(body));
                          setCollapseActive({
                            ...collapseActive,
                            parent: data,
                          });
                        }
                      }}
                      childActive={collapseActive.children}
                      onClickCollapseChild={(data: any, type) => {
                        const body = {
                          master_id: state.masterId,
                          service_group_type: type,
                          id: data,
                        };
                        if (collapseActive.children === data) {
                          setCollapseActive({
                            ...collapseActive,
                            children: "",
                          });
                        } else {
                          dispatch(getResultDetailChild(body));
                          setCollapseActive({
                            ...collapseActive,
                            children: data,
                          });
                        }
                      }}
                    />
                  </div>
                ))}
            </div>
          </>
        ) : (
          <Box className="h-screen flex items-center justify-center">
            <Loading hasText={false} text={""} />
          </Box>
        )
      ) : null}
      {!!stateImagePreview.visible && (
        <PreviewImages
          visible={!!stateImagePreview.visible}
          activeIndex={Number(stateImagePreview.activeIndex)}
          images={stateImagePreview.images}
          onClose={() => {
            setStateImagePreview({
              ...dataImagePreview,
              visible: false,
            });
            dispatch(
              setImagePreview({
                visible: false,
                images: [],
                activeIndex: 0,
              })
            );
          }}
        />
      )}
      {variant === "default" ? (
        <>
          <Header
            title="Chi tiết lượt khám"
            className="p-booking_headers"
            showBackIcon
            backgroundColor="#fff"
            onBackClick={() => navigate(-1)}
          />
          <Box height={60} />
          {memoryInfo}
          <div className="mt-2 px-1 overflow-scroll  detail-exam-wrapper">
            {state.listCategory
              ?.filter((fill) => fill.service_group_type !== "EMR")
              ?.map((item, index) => (
                <div
                  key={index}
                  id={
                    collapseActive.parent === item.service_group_type
                      ? "record-actives"
                      : ""
                  }
                >
                  <ListCategoriesResult
                    data={item}
                    pageActive={
                      collapseActive.parent === item.service_group_type
                    }
                    onClickCollapse={(data: any) => {
                      const body = {
                        master_id: state.masterId,
                        service_group_type: data,
                        id: !!item.items?.length ? item.items[0].id : "",
                      };
                      if (collapseActive.parent === data) {
                        setCollapseActive({ ...collapseActive, parent: "" });
                      } else {
                        dispatch(getResultDetailParent(body));
                        setCollapseActive({ ...collapseActive, parent: data });
                      }
                    }}
                    childActive={collapseActive.children}
                    onClickCollapseChild={(data: any, type) => {
                      const body = {
                        master_id: state.masterId,
                        service_group_type: type,
                        id: data,
                      };
                      if (collapseActive.children === data) {
                        setCollapseActive({ ...collapseActive, children: "" });
                      } else {
                        dispatch(getResultDetailChild(body));
                        setCollapseActive({
                          ...collapseActive,
                          children: data,
                        });
                      }
                    }}
                  />
                </div>
              ))}
                
          </div> 
           <button className={`${getButtonColor()}   py-2 px-2 rounded-lg font-[600] text-center fixed overflow-hidden`}
           style={{bottom: 20
            ,
            width: "80%",
            left:"50%",
            right:"50%"
           }}
           disabled={downloading}
        onClick={handleShare}
           
          >
            {downloading ? `Đang tải... ${progress}%` : <><Icon
              className={`text-[#fffff] transition-all transform}`}
              icon={"zi-download"}
            /><span className="ml-2" style={{marginLeft:"5px"}}>Tải toàn bộ kết quả</span></>}
          </button>
        </>
      ) : null}
      {!!stateImagePreview.visible && (
        <PreviewImages
          visible={!!stateImagePreview.visible}
          activeIndex={Number(stateImagePreview.activeIndex)}
          images={stateImagePreview.images}
          onClose={() => {
            setStateImagePreview({
              ...dataImagePreview,
              visible: false,
            });
            dispatch(
              setImagePreview({
                visible: false,
                images: [],
                activeIndex: 0,
              })
            );
          }}
        />
      )}
     
    </Page>
  );
}

export default MedicalExamPageZNS;
